                [
                    'direction_id'    => $direction->id,
                    'kurator_id'      => $kuratorId,
                    'kafedra_id'      => $kafedra?->id,
                    'enrollment_year' => $enrollmentYear,
                    'status'          => true,
                ]
            );
            $created++;
        }

        $this->command->info("✅ {$created} ta guruh muvaffaqiyatli qo\'shildi!");
        if ($skipped > 0) {
            $this->command->warn("⚠️  {$skipped} ta guruh o\'tkazib yuborildi.");
        }
    }
}
